### Describe the issue

If I load the model in the same scope, like in the main function, model inference happens fine. If model is loaded in another function, I get 

>  Non-zero status code returned while running X

where X can be any node within the model.

### To reproduce

Loading the model and using as such

`Ort::Session loadModel() {
    string instanceName = "ORTefficient";
    Ort::Env env(OrtLoggingLevel::ORT_LOGGING_LEVEL_WARNING,
        instanceName.c_str());

    Ort::SessionOptions so;
    const wchar_t* model_path = L"250.onnx";
    Ort::Session sess{ env,model_path,so };
    return sess;
}

int main()
{
    Ort::Session sess = loadModel();

    cv::Mat img = loadImage("test.jpg");
    vector<float> result = runImage(img, sess);
    std::cout << "Hello World!\n";
}`

Other functions

`using namespace std;
cv::Mat loadImage(const char* img_path) {
    try {
        //freopen("output.txt","w",stdout);

        cv::Mat imageBGR = cv::imread(img_path);
        cv::Mat resizedImageBGR, resizedImageRGB, resizedImage, preprocessedImage;
        cv::resize(imageBGR, resizedImageBGR,
            cv::Size(300, 300),
            0, 0, cv::InterpolationFlags::INTER_NEAREST);




        cv::cvtColor(resizedImageBGR, resizedImageRGB,
            cv::ColorConversionCodes::COLOR_BGR2RGB);

        //cout << resizedImageRGB << endl;

        resizedImageRGB.convertTo(resizedImage, CV_32F, 1.);

        cv::Mat channels[3];
        cv::split(resizedImage, channels);
        cv::merge(channels, 3, resizedImage);
        //cout << resizedImage << endl;

        // HWC to CHW
        cv::dnn::blobFromImage(resizedImage, preprocessedImage);
        return preprocessedImage;
    }
    catch (cv::Exception& e) {
        std::string errorStr = e.what();

        cout << "Caught CV error: " << errorStr << endl;
        cv::Mat temp;
        return temp;

    }
}

vector<float> runImage(cv::Mat preprocessedImage, Ort::Session& sess) {
    //Model inference, current loading model from disk and then inference. Best practice is to change so that np array can be parsed directly into blob.

    const char* inputNames[] = { "input_2" };
    const char* outputNames[] = { "dense" };

    std::array<int64_t, 4> input_shape_{ 1, 3, 300, 300 };
    std::array<int64_t, 2> output_shape_{ 1, 256 };



    size_t inputTensorSize = 270000;
    std::vector<float> inputTensorValues(inputTensorSize);
    inputTensorValues.assign(preprocessedImage.begin<float>(),
        preprocessedImage.end<float>());

    //for (auto a : inputTensorValues){
    //    printf("%.1f ",a);
    //}
    printf("\n");

    size_t outputTensorSize = 256;
    std::vector<float> outputTensorValues(outputTensorSize);

    //std::vector<Ort::Value> inputTensors;
    //std::vector<Ort::Value> outputTensors;

    Ort::Value inputTensors{ nullptr };
    Ort::Value outputTensors{ nullptr };

    auto memoryInfo = Ort::MemoryInfo::CreateCpu(OrtDeviceAllocator, OrtMemTypeCPU);
    inputTensors = Ort::Value::CreateTensor<float>(memoryInfo, inputTensorValues.data(), inputTensorSize, input_shape_.data(), input_shape_.size());
    outputTensors = Ort::Value::CreateTensor<float>(memoryInfo, outputTensorValues.data(), outputTensorSize, output_shape_.data(), output_shape_.size());

    try {
        sess.Run(Ort::RunOptions{ nullptr }, inputNames, &inputTensors, 1, outputNames, &outputTensors, 1);
    }
    catch (Ort::Exception& e) {
        cout << e.what() << endl;
    }


    //std::vector<double> doubleVec(outputTensorValues.begin(), outputTensorValues.end());

    return outputTensorValues;
}`


